import {createRouter,createWebHashHistory} from 'vue-router'

const routes = [
    // 登录页面
    {
        path: '/',
        name: 'login',
        component: ()=>import(/*webpackChunkName:'Login'*/ '@/page/login/login')
    },
    // 主页面
    {
        path: '/index',
        name: 'index',
        component: ()=>import(/*webpackChunkName:'Index'*/ '@/page/index/index')
    },
    // 物理机页面
    {
        path: '/server',
        name: 'server',
        component: ()=>import(/*webpackChunkName:'Server'*/ '@/page/server-page/server')
    },
    // 虚拟机页面
    {
        path: '/vm',
        name: 'vm',
        component: ()=>import(/*webpackChunkName:'Vm'*/ '@/page/vm-page/vm')
    },
    // 网络设备页面
    {
        path: '/networks',
        name: 'networks',
        component: ()=>import(/*webpackChunkName:'Networks'*/ '@/page/networks-page/networks')
    },
    // 资源分组页面
    {
        path: '/tag',
        name: 'tag',
        component: ()=>import(/*webpackChunkName:'Tag'*/ '@/page/tag-page/tag')
    }
]

const router = createRouter({
    history: createWebHashHistory(),
    routes
})

export default router
